import React from 'react';
import {SingleLinks,DropDownLinks} from './PageLinks';
import ToggleDarkMode from './ToggleDarkMode';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container'

const NavBar = () => {
    return (
        <Navbar collapseOnSelect expand="lg" bg="#2496ed" variant="white">
        <Container>
            <Navbar.Brand>BDO<br/>Tracker</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="justify-content-center">
                        {SingleLinks.map((item)=> {
                            return (
                                <Nav.Link href={item.url}>{item.title} </Nav.Link>
                            )
                        })}
                    <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                        {DropDownLinks.map((item)=> {
                            return (
                                <Nav.Link href={item.url}>{item.title} </Nav.Link>
                            )
                        })}
                    </NavDropdown>
                </Nav>
                <Nav  className="justify-content-end">
                    <ToggleDarkMode/>
                </Nav>
                </Navbar.Collapse>
        </Container>
      </Navbar>

        );
    }

export default NavBar
